import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <nav className="navbar navbar-dark bg-warning">
        <div className="container">
          <a className="navbar-brand fw-bold fs-4 text-dark">T-AUFGABE</a>
          <form className="d-flex" role="search">
            <input
              className="form-control me-2"
              type="search"
              placeholder="Search"
              aria-label="Search"
            />
            <div className="buttons d-flex">
                <a href="" className="btn btn-outline-dark d-flex align-items-center">
                    <i className="fa fa-sign-in me-2"></i> Login</a>
                <a href="" className="btn btn-outline-dark ms-1 d-flex align-items-center">
                <i class="fa fa-shopping-cart me-2 " aria-hidden="true"></i> (0)</a>
            </div>


          </form>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
